s\n","irt_data <- na.omit(irt_data)\n","\n","# Ensure positive indices\n","irt_data <- irt_data %>%\n","  mutate(\n","    encoded_player_id = as.numeric(as.factor(encoded_player_id)),\n","    encoded_constellation_id = as.numeric(as.factor(encoded_constellation_id))\n","  )\n","\n","# Remove items with insufficient variability\n","items_with_single_response <- irt_data %>%\n","  group_by(encoded_constellation_id) %>%\n","  summarize(n_distinct_responses = n_distinct(response)) %>%\n","  filter(n_distinct_responses <= 1) %>%\n","  pull(encoded_constellation_id)\n","\n","irt_data_filtered <- irt_data %>%\n","  filter(!encoded_constellation_id %in% items_with_single_response)\n","\n","# Convert to wide format\n","irt_data_wide <- irt_data_filtered %>%\n","  spread(key = encoded_constellation_id, value = response)\n","\n","# Ensure that player ID is the row identifier\n","row.names(irt_data_wide) <- irt_data_wide$encoded_player_id\n","irt_data_wide <- irt_data_wide %>%\n","  select(-encoded_player_id) %>%\n","  as.data.frame()"]},{"cell_type":"code","execution_count":5,"id":"6e86f7da","metadata":{"execution":{"iopub.execute_input":"2024-01-02T10:51:24.953076Z","iopub.status.busy":"2024-01-02T10:51:24.952121Z","iopub.status.idle":"2024-01-02T10:51:25.125802Z","shell.execute_reply":"2024-01-02T10:51:25.124616Z"},"papermill":{"duration":0.181737,"end_time":"2024-01-02T10:51:25.12758","exception":false,"start_time":"2024-01-02T10:51:24.945843","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 1735 × 173</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>1</th><th scope=col>2</th><th scope=col>3</th><th scope=col>4</th><th scope=col>5</th><th scope=col>6</th><th scope=col>7</th><th scope=col>8</th><th scope=col>9</th><th scope=col>10</th><th scope=col>⋯</th><th scope=col>164</th><th scope=col>165</th><th scope=col>166</th><th scope=col>167</th><th scope=col>168</th><th scope=col>169</th><th scope=col