rgument specifies that only complete pairs of observations are used in the correlation calculation.\n","\n","**Aggregating Constellation Difficulties and Calculating Correlation for Constellation Difficulties**: Constellation difficulties are aggregated (although in this case, it is not be necessary). The estimated difficulties are then merged with the aggregated difficulties. Finally, the correlation between the estimated constellation difficulties and the external constellation difficulties is calculated."]},{"cell_type":"code","execution_count":11,"id":"93cec277","metadata":{"execution":{"iopub.execute_input":"2024-01-02T10:57:31.320299Z","iopub.status.busy":"2024-01-02T10:57:31.319181Z","iopub.status.idle":"2024-01-02T10:57:31.712194Z","shell.execute_reply":"2024-01-02T10:57:31.710941Z"},"papermill":{"duration":0.406784,"end_time":"2024-01-02T10:57:31.713883","exception":false,"start_time":"2024-01-02T10:57:31.307099","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A matrix: 1735 × 1 of type dbl</caption>\n","<thead>\n","\t<tr><th scope=col>F1</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>-1.2340845</td></tr>\n","\t<tr><td>-1.8534492</td></tr>\n","\t<tr><td>-1.1568218</td></tr>\n","\t<tr><td>-2.8879292</td></tr>\n","\t<tr><td>-2.5267860</td></tr>\n","\t<tr><td> 2.0466671</td></tr>\n","\t<tr><td> 3.5978577</td></tr>\n","\t<tr><td>-2.1471727</td></tr>\n","\t<tr><td> 1.6888906</td></tr>\n","\t<tr><td>-0.1721182</td></tr>\n","\t<tr><td>-1.1811719</td></tr>\n","\t<tr><td> 3.2400922</td></tr>\n","\t<tr><td> 1.7510258</td></tr>\n","\t<tr><td> 2.7512126</td></tr>\n","\t<tr><td>-2.2070313</td></tr>\n","\t<tr><td>-1.0839033</td></tr>\n","\t<tr><td>-1.8152628</td></tr>\n","\t<tr><td>-1.8420178</td></tr>\n","\t<tr><td>-1.8534492</td></tr>\n","\t<tr><td> 2.0081653</td></tr>\n","\t<tr><td> 1.6685987</td></tr>\n","\t<tr><td>-2.1682174</td></tr>\n","\t<tr><td>-1.8519304</td></tr>\n","\t<tr><td>-2.9477573</td></tr>\n