4.68787680        "]},"metadata":{},"output_type":"display_data"}],"source":["# Extract the 'b' parameters directly from the matrix\n","difficulty_estimates <- item_parameters$items[, \"b\"]\n","\n","# Create a data frame for item difficulties\n","item_difficulties_long <- data.frame(\n","  encoded_constellation_id = 1:nrow(item_parameters$items),\n","  difficulty_estimate = difficulty_estimates\n",")\n","\n","item_difficulties_long"]},{"cell_type":"code","execution_count":15,"id":"65254825","metadata":{"execution":{"iopub.execute_input":"2024-01-02T10:57:31.984101Z","iopub.status.busy":"2024-01-02T10:57:31.983035Z","iopub.status.idle":"2024-01-02T10:57:32.025553Z","shell.execute_reply":"2024-01-02T10:57:32.023034Z"},"papermill":{"duration":0.058106,"end_time":"2024-01-02T10:57:32.027559","exception":false,"start_time":"2024-01-02T10:57:31.969453","status":"completed"},"tags":[]},"outputs":[],"source":["# Read the external data\n","data_for_rasch <- read.csv('/kaggle/input/chess-constellation-datasets/data_for_rasch.csv')"]},{"cell_type":"code","execution_count":16,"id":"132c6513","metadata":{"execution":{"iopub.execute_input":"2024-01-02T10:57:32.055909Z","iopub.status.busy":"2024-01-02T10:57:32.054589Z","iopub.status.idle":"2024-01-02T10:57:32.093803Z","shell.execute_reply":"2024-01-02T10:57:32.091957Z"},"papermill":{"duration":0.055164,"end_time":"2024-01-02T10:57:32.095918","exception":false,"start_time":"2024-01-02T10:57:32.040754","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["-0.0111974072358962"],"text/latex":["-0.0111974072358962"],"text/markdown":["-0.0111974072358962"],"text/plain":["[1] -0.01119741"]},"metadata":{},"output_type":"display_data"}],"source":["# Choose Max Player Ratings for each player ID since they might change across games\n","player_ratings <- aggregate(player_rating ~ encoded_player_id, data = data_for_rasch, FUN = max)\n","\n","# Merge the aggregated player ratings with the estimated abilities\n","player_data_merged <- merge(player_abilities_long, player_ratings, by = \"encoded_player_id\")\n","\n","# Calculate the correlation between estimated abilities and external player ratings\n","cor_player <- cor(player_data_merged$ability_estimate, player_data_merged$player_rating, use = \"complete.obs\")\n","\n","cor_player"]},{"cell_type":"markdown","id":"21ff8ce8","metadata":{"papermill":{"duration":0.01251,"end_time":"2024-01-02T10:57:32.120813","exception":false,"start_time":"2024-01-02T10:57:32.108303","status":"completed"},"tags":[]},"source":["**Poor Player Abilities Correlation:** Poor player ratings correlation may reflect the data quality of player ratings in the sample dataset from Lichess and not ELO ratings."]},{"cell_type":"code","execution_count":17,"id":"f4682a75","metadata":{"execution":{"iopub.execute_input":"2024-01-02T10:57:32.149021Z","iopub.status.busy":"2024-01-02T10:57:32.147645Z","iopub.status.idle":"2024-01-02T10:57:32.171888Z","shell.execute_reply":"2024-01-02T10:57:32.169949Z"},"papermill":{"duration":0.0406,"end_time":"2024-01-02T10:57:32.174037","exception":false,"start_time":"2024-01-02T10:57:32.133437","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["0.108100404003407"],"text/latex":["0.108100404003407"],"text/markdown":["0.108100404003407"],"text/plain":["[1] 0.1081004"]},"metadata":{},"output_type":"display_data"}],"source":["# Aggregate constellation difficulties although there is no difference\n","constellation_difficulties <- aggregate(difficulty ~ encoded_constellation_id, data = data_for_rasch, FUN = mean)\n","\n","# Merge the aggregated constellation difficulties with the estimated difficulties\n","constellation_data_merged <- merge(item_difficulties_long, constellation_difficulties, by = \"encoded_constellation_id\")\n","\n","# Calculate the correlation between estimated difficulties and external constellation difficulties\n","cor_constellation <- cor(constellation_data_merged$difficulty_estimate, constellation_data_merged$difficulty, use = \"complete.obs\")\n","\n","cor_constellation"]},{"cell_type":"markdown","id":"4d7550c1","metadata":{"papermill":{"duration":0.013696,"end_time":"2024-01-02T10:57:32.200756","exception":false,"start_time":"2024-01-02T10:57:32.18706","status":"completed"},"tags":[]},"source":["**Small Constellation Difficulty Correlation**: Small correlation suggest that our calculation of constellation difficulties may not be ideal. Presence of very sparse data could also lead to poor estimates of both latent variables."]},{"cell_type":"markdown","id":"0e5b4688","metadata":{"papermill":{"duration":0.012139,"end_time":"2024-01-02T10:57:32.22537","exception":false,"start_time":"2024-01-02T10:57:32.213231","status":"completed"},"tags":[]},"source":["# Considerations for modifications to current process for real data subsequently\n","\n","1. **Model Complexity**: The Rasch model is relatively simple and assumes that each item (chess constellation) has a single difficulty parameter, and each person (player) has a single ability parameter. However, this may not be true considering that the layout of the game may affect how difficult the constellation is. There may also be the presence of a discrimination. We may want to adopt the 2PL/3PL which allows items to have different discrimination parameters, recognizing that some items may be better at distinguishing between respondents with different levels of the latent trait.\n","\n","2. **Constellation Selection**: We may want to consider further selection/exclusion of constellations, especially with the largely sparse dataset where many players do not engage in a lot of the constellations.\n","\n","3. **Constellation Difficulty Calculation**: The way constellation difficulty is calculated might not capture the true complexity or strategic importance of each constellation. If the difficulty scores don't vary meaningfully across different constellations or don't align well with how players actually perceive or react to these constellations, they may not be effective predictors. Perhaps the average centipawn loss calculation might be a good factor to add into constellation difficulty. Other alternatives were suggested earlier in the Python notebook.\n","\n","4. **Player Performance**: The binary outcome is analogous to the response pattern in IRT. However, it's important to note that in the context of chess, a win/loss outcome may not directly correspond to a correct/incorrect response without considering the strength of the opponent. The Rasch model typically assumes that the probability of success on an item is independent of other items and respondents, which may not fully capture the competitive nature of chess where the outcome also depends on the opponent's ability. Capturing this rating differences in match-up could help to better discriminate outcomes as a performance.\n","\n","4. **Data Quality**: This is a loose dataset of 20k games from online platform which may pose concerns on the quality and model accuracy."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":4236669,"sourceId":7305059,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":372.116156,"end_time":"2024-01-02T10:57:32.356317","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-01-02T10:51:20.240161","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}